import { Link } from 'react-router-dom';

const Playlist = ({url, playlist, playlists, deletePlaylist}) => {

    return (
        <li>
            <Link key={playlist.id} to={`${url}/${playlist.id}/songs`}>{playlists[playlistIndex].name}</Link>
            <button onClick={ () => deletePlaylist(playlists[playlistIndex].id)} > X </button>
        </li>
    );
  }

export default Playlist;
